    "siletz-bay-oregon-coast-invasive-species-mapping-monitoring-and-eradication-program",nt"isopen":
    false,nt"url": null,nt"notes": "The primary ecological goal for Siletz
    Bay refuge is to allow natural tidal processes to guide estuary function with little
    human influence. This holds true for the marshlands but is more difficult to achieve
    in the surrounding uplands and forestlands due to the presence of invasive species.
    In these areas hands-on weed control is imperative to prevent the further spread
    of invasive species and subsequent degradation of the forest. This project used
    volunteers to detect, identify, map, treat and monitor invasive plants species on
    all uplands within Siletz Bay National Wildlife Refuge.",nt"license_title":
